import base64
import webbrowser
from json import load
from math import ceil
from os import listdir, path, makedirs, remove
from os.path import exists, isfile, join
from PIL import Image, ImageOps
import tkinter as tk

uiData = ""
uiData = base64.b64decode(uiData)
uiFile = open("ui.png", "wb")
uiFile.write(uiData)
uiFile.close()

if not path.exists('textures/'):
    makedirs('textures/')

window = tk.Tk()
window.title("Crafting Visualizer")
# ICON
icon = ""
""" BASE64 VERSION OF THE ICON """
iconData = base64.b64decode(icon)
tempFile = "tkIcon.ico"  # Save base64 as temp ico
iconFile = open(tempFile, "wb")
iconFile.write(iconData)
iconFile.close()
window.wm_iconbitmap(tempFile)

mainFrame = tk.Frame(master=window, width=100, height=150)
mainFrame.pack(padx=5, pady=5)

show = tk.IntVar()

replace = {}


def create():
    secondaryFrame.forget()
    if altEntry.get() != "":
        print('Restarting')
        replace[altLabel['text']] = altEntry.get() + ".png"
        altEntry.delete(0, tk.END)
        startButton['text'] = "Start"
        messageLabel['text'] = "Ready to Start"
    if recipeDirEntry.get()[:-1] != '\\':
        recipeDirEntry.insert(tk.END, '\\')
    recipeDirEntry['state'] = 'disabled'
    checkEntry['state'] = 'disabled'

    recipesDir = recipeDirEntry.get()
    recipes = [f for f in listdir(recipesDir) if isfile(join(recipesDir, f))]
    for recipe in range(len(recipes)):
        window.update()
        craft = recipesDir + recipes[recipe]
        print("Reading " + recipes[recipe])
        # Clean file of comments
        file = open(craft, 'r')
        lines = file.readlines()
        file = open(craft, 'w')
        for line in lines:
            if '//' not in line.strip("\n"):
                file.write(line)
            else:
                file.write(line[:line.index('//')] + '\n')

        # Load JSON
        file = open(craft)
        data = load(file)

        try:
            name = data["minecraft:recipe_shapeless"]["description"]["identifier"]
            craftType = True  # Shapeless
        except KeyError:
            name = data["minecraft:recipe_shaped"]["description"]["identifier"]
            craftType = False  # Shaped

        # Create file
        name = name[name.index(':') + 1:] + ".png"
        window.update()

        def place(texture, loc):
            """
            Creates a repeating event Tuesdays at 5-6pm starting after exclude
            ex. debate(upcomingMeeting)
            :param texture: file name
            :type texture: basestring
            :param loc: grid location, 9 for result
            :type loc: int
            """
            grid = ["74, 74", "222, 74", "372, 74",
                    "74, 222", "222, 222", "372, 222",
                    "74, 372", "222, 372", "372, 372",
                    "848, 214"]
            paste = Image.open("textures/" + texture)
            width, height = paste.size
            if width != height:
                resize = ceil((height - width) / 2)
                paste = ImageOps.expand(paste, resize, (0, 0, 0, 0))
                paste = paste.crop((0, resize, height, height + resize))
            if loc == 9:
                newSize = eval("133, 133")
            else:
                newSize = eval("117, 117")
            paste = paste.resize(newSize, Image.NEAREST)
            image.paste(paste, eval(grid[loc]), paste)

        if not path.exists(name):
            if craftType:
                window.update()
                # Shapeless
                arr = []
                # Get ingredients in order
                for i in range(len(data["minecraft:recipe_shapeless"]["ingredients"])):
                    item = data["minecraft:recipe_shapeless"]["ingredients"][i]['item']
                    item = item[item.index(':') + 1:]
                    if exists("textures\\" + item + ".png"):
                        arr.append(item + ".png")
                    else:
                        window.update()
                        try:
                            arr.append(replace[item])
                            print("Retrieved " + replace[item])
                        except KeyError:
                            error(item)
                            window.update()
                            return None
                # Get result
                try:
                    result = data["minecraft:recipe_shapeless"]["result"][0]["item"]
                except KeyError:
                    result = data["minecraft:recipe_shapeless"]["result"]["item"]
                result = result[result.index(':') + 1:]
                if exists("textures\\" + result + ".png"):
                    arr.append(result + ".png")
                else:
                    window.update()
                    try:
                        arr.append(replace[result])
                        print("Retrieved " + replace[result])
                    except KeyError:
                        error(result)
                        window.update()
                        return None

            else:
                window.update()
                # Shaped
                # Get item with key
                items = {}
                for i in range(len(data["minecraft:recipe_shaped"]["key"])):
                    char = list(data["minecraft:recipe_shaped"]["key"].keys())[i]
                    item = data["minecraft:recipe_shaped"]["key"][char]["item"]
                    item = item[item.index(':') + 1:]
                    if exists("textures\\" + item + ".png"):
                        items[char] = item + ".png"
                    else:
                        window.update()
                        try:
                            items[char] = replace[item]
                            print("Retrieved " + replace[item])
                        except KeyError:
                            error(item)
                            window.update()
                            return None
                # Place items in pattern order
                arr = []
                for i in range(len(data["minecraft:recipe_shaped"]["pattern"])):
                    string = data["minecraft:recipe_shaped"]["pattern"][i]
                    for j in range(len(string)):
                        arr.append(items[string[j:j + 1]])
                    while len(arr) % 3 != 0:
                        arr.append('')
                # Get result
                try:
                    result = data["minecraft:recipe_shaped"]["result"][0]["item"]
                except KeyError:
                    result = data["minecraft:recipe_shaped"]["result"]["item"]
                result = result[result.index(':') + 1:]
                if exists("textures\\" + result + ".png"):
                    arr.append(result + ".png")
                else:
                    window.update()
                    try:
                        arr.append(replace[result])
                        print("Retrieved " + replace[result])
                    except KeyError:
                        error(result)
                        window.update()
                        return None

                # Create image
                Image.open('ui.png').save(name)
                image = Image.open(name)
                window.update()
                for i in range(len(arr) - 1):
                    if arr[i] != '':
                        place(arr[i], i)
                place(arr[len(arr) - 1], 9)
                image.save(name)
                print("Saved " + name)
                print()
                window.update()
                if show.get():
                    with open('recipe.html', 'w', encoding="utf-8") as output_file:
                        output_file.write(
                            '<html style="height: 100%;"><head><meta name="viewport" content="width=device-width, mini'
                            + 'mum-scale=0.1"/><link rel="shortcut icon" type="image/png" href="tkIcon.ico"/><title>')
                        output_file.write(name)
                        output_file.write(
                            '</title></head><body style="margin:0px; background-color:#0e0e0e; background-image:url(')
                        output_file.write(name)
                        output_file.write(
                            '); background-size:contain; background-repeat:no-repeat; background-position: center cent'
                            + 'er;"></body></html>')
                    webbrowser.open('recipe.html')
        else:
            print(name + ' already exists')
        window.update()
    recipeDirEntry['state'] = 'normal'
    checkEntry['state'] = 'normal'
    print('Process finished')


def error(name):
    print(name+' not found')
    secondaryFrame.pack(padx=5, pady=5)
    replaceLabel['text'] = name + ".png not found\nEnter alternative then Restart"
    messageLabel['text'] = "Ready to Restart"
    altLabel['text'] = name
    startButton['text'] = "Restart"
    window.update()


